insert  into `course`(`id`,`subject`,`course_number`,`title`,`description`) values (3851,'BASK',101,'Survey of the History of Basket Weaving',''),(3852,'BASK',201,'Making Baskets with Aesthetic merit',''),(4208,'BASK',300,'advanced weaving','practical application course to demonstrate dexterity and intricate technique'),(4209,'BASK',105,'Fundamentals in Basket Weaving Technique',''),(4211,'BASK',404,'External internship in Basket Weaving',''),(4311,'BASK',303,'Contemporary weaving applications',''),(4314,'BASK',900,'Dissertation in basketweaving',''),(4391,'BASK',400,'Presentation in department seminar series',''),(4392,'BASK',202,'Structures of baskets',''),(4393,'BASK',301,'Corporate Basket Weaving',''),(4473,'BASK',499,'Honours thesis',''),(4495,'BASK',115,'Geographical dispersion of materials',''),(4496,'BASK',676,'Trial by Fire',''),(4497,'BASK',444,'seminar',''),(4498,'BIOLOGY',101,'Introductory Biology',''),(4499,'METHODS',101,'Science Methods (Test only)','Science methods course.'),(4500,'PHYSICS',101,'Introductory Physics (Test only)',''),(4501,'PHYS',330,'Teaching Physics (Cal Poly)','Designed for undergraduates considering careers in science teaching, this course introduces inquiry approaches to teaching physics incorporating insights from physics education research and the use of computer technology. Emphasis is placed on introducing pedagogical approaches to help others develop basic models of physics through experimentation, developing skills in scientific discourse and presentation, and formative and summative assessment of the learning of others.'),(4502,'PHYSICS',303,'Teaching Physics (Cal Poly)','Designed for undergraduates considering careers in science teaching, this course introduces inquiry approaches to teaching physics incorporating insights from physics education research and the use of computer technology. Emphasis is placed on introducing pedagogical approaches to help others develop basic models of physics through experimentation, developing skills in scientific discourse and presentation, and formative and summative assessment of the learning of others.'),(4503,'EDUCATION',424,'Organizing and Teaching Science (Cal Poly)','Techniques, aims and objectives in the teaching of physical and life sciences at the secondary level. Selection and organization of teaching material, including strategies for English language learners (ELL) and special needs students. Evaluation of results.'),(4504,'PHYS',302,'Classical Mechanics I (Cal Poly)','Laws of motion, kinematics and dynamics of a particle. Use of numerical methods for solving problems. Work and energy. Linear and angular momentum. Lagrange\'s and Hamilton\'s equations and the calculus of variations. Newton\'s Law of gravity, Kepler\'s laws of orbital motion, and central force problems.'),(4505,'PSC',424,'Organizing and Teaching Science (Cal Poly)','Techniques, aims and objectives in the teaching of physical and life sciences at the secondary level. Selection and organization of teaching material, including strategies for English language learners (ELL) and special needs students. Evaluation of results.'),(4506,'PSC',103,'The Physical Environment: Earth (Cal Poly)','Introduction to the basic principles of the earth sciences, and applications of these principles in modern society. Structure and formation of the Earth, earthquakes, weather, and oceanography. 3 lectures, 1 laboratory.'),(4507,'MATH',131,'Calculus I',''),(4508,'GEOL',106,'Environmental Geology (UNL)','Introductory-level course that satisfies the college\'s core requirement for science; most students who enroll are non-science majors'),(4509,'UGIS',188,'Research Methods for Science and Mathematics K-12 Teachers (Berkeley)','Students undertake several in-depth research projects to develop methods for engaging in authentic research in the science or mathematics content area related to their major. Interactive lectures and labs are designed to meet the needs of future teachers by practicing specific techniques-including statistics, mathematical modeling, and scientific writing-needed to address scientific questions so that they may guide their future K-12 students to develop skills in problem solving and research.'),(4510,'UGIS',187,'Project Based Instruction (Berkeley)','Framed around the environmental science topic of sustainability, the course engages students from different math, science, and engineering majors in the process of applying the content knowledge from their discipline to build project-based curricula for presentation as part of a 45-hour field placement in a local high school classroom. Students develop pedagogical content knowledge and relate teaching theory to practice through readings, classroom activities, discussion, lesson planning, and field observations.'),(4511,'MCDB',1030,'Molecules, Plagues and People (Boulder)','non-majors intro to biology; explores human relationships with microbes and the immune system'),(4512,'MCDB',1041,'Human Genetics (Boulder)','non-majors intro to genetics from human perspective'),(4513,'EDUC',414,'Curriculum and Inquiry in Public Schools','Principles, methods and practices of organizing curriculum, instruction, and assessment for secondary subject area content, with an emphasis on backward design in curriculum development and assessment.'),(4514,'ASTR',301,'The Solar System','Quantitative and descriptive properties of the Solar System including the physics of the planets, their satellites, comets and interplanetary media. Possible origins of the Solar System. 3 lecture');

