insert  into `course_outcome`(`id`,`name`,`description`,`course_outcome_group_id`) values (432,'Knowing which types of wicker are good to use','',NULL),(433,'Selecting for the maximum flexibility of wicker strands','',NULL),(434,'Ability to create a small (< 10\") basket','',NULL),(435,'Develop an appreciation for the weaving of Baskets','',NULL),(465,'Participate in the collegial  profession of Basket Weavers','',NULL),(470,'select appropriate weaving materials','',NULL),(471,'select appropriate weaving materials','',NULL),(472,'select appropriate materials','',NULL),(477,'Plan patterns with colourful materials','',NULL),(478,'Understand the process of basket weaving.','',NULL),(483,'articulate 3 modes of thought about baskets','',NULL),(485,'By the end of this course the student should be able create a basket by applying the weaving skill.','',NULL),(533,'By the end of this course the students will communicate the benefits of basket weaving. ','',NULL),(534,'By the end of this course the student should be able to demonstrate their skill by weaving a basket','',NULL),(549,'recall the basic variations in patterns for baskets','',NULL),(550,'describe the differences between historic patterns','',NULL),(551,'create the proper weave technique','',NULL),(552,'weave 10 baskets in one hour','',NULL),(579,'By the end of this course the students should be able to construct  an functional basket.','',NULL),(984,'No match to a course outcome',NULL,NULL),(985,'weave','',NULL),(1187,'APA writing style knowledge ','',NULL),(1434,'Apply critical thinking skills','',NULL),(1435,'Reflection on learning experience ','',NULL),(1436,'Understand the structure and interactions of matter at the bulk scale are determined by electrical forces within and between atoms. (secondary to HS-PS2-6)','',NULL),(1437,'Ask questions that arise from careful observation of phenomena, or unexpected results, to clarify and/or seek additional information.','',NULL),(1438,'Ask questions that arise that arise from examining models or a theory, to clarify and/or seek additional information and relationships.','',NULL),(1439,'The wavelength and frequency of a wave are related to one another by the speed of travel of the wave, which depends on the type of wave and the medium through which it is passing. (HS-PS4-1)','',NULL),(1440,'test','',NULL),(1441,'Ask questions that arise from careful observation of phenomena, or unexpected results, to clarify and/or seek additional information.','',NULL),(1442,'blah blah','',NULL),(1443,'blah blah','',NULL),(1444,'Design a project based instruction lesson series containing essential PBI components and utilizing constructivist classroom activities and exercises','',NULL),(1445,'Develop and present inquiry-based lesson around school site sustainability (energy usage, water usage, school yard ecosystem, waste stream management, school transportation footprint, school indoor and outdoor air quality), set of aligned readings, and set of formative and summative assessment tools','',NULL),(1446,'Project based instruction pedagogy literature discussion leadership','',NULL),(1447,'Lesson presentation in host classroom','',NULL),(1448,'Inquiry lesson presentation in host classroom','',NULL),(1449,'1. Analyze phenotypic data and deduce patterns of inheritance from family histories.  \n','',NULL),(1450,'\n2. Describe the molecular anatomy of genes and genomes.  \n','',NULL),(1451,'3. Describe the mechanisms by which an organism\'s genome is passed on to the next generation.  \n\n','',NULL),(1452,'4. Describe the phenomenon of linkage and how it affects assortment of alleles during meiosis.  \n ','',NULL),(1453,'5. Extract information about genes, alleles, and gene functions by analyzing the progeny from genetic crosses.  \n\n','',NULL),(1454,'6. Compare different types of mutations and describe how each can affect genes and the corresponding mRNAs and proteins.  \n\n','',NULL),(1455,'7. Interpret results from molecular analyses to determine the inheritance patterns and identities of human genes that can mutate to cause disease.','',NULL),(1456,'Understand and appreciate the way genetics is done, and its impact on human society.','',NULL),(1457,'know about and be able to use different tools researchers use to solve scientific problems (i.e., experimental design, statistical analysis, etc.)','',NULL),(1458,'know about and have gained practice in communicating research (i.e., through peer-reviewed scientific literature)','',NULL),(1459,'understand how scientists and researchers develop new knowledge and insights, the most important of which are eventually presented in textbooks and taught in conventional science and mathematics classes','',NULL),(1460,'know about ways of implementing scientific practices in secondary (esp. high school) classrooms','',NULL),(1461,'Students will understand the importance of constructivist learning by experiencing and reflecting on the impact it has on them as learners and future teachers. ','',NULL),(1462,'Students will understand the importance of teacher reflection in creating and maintaining an effective environment in which all students have the opportunity to learn (Universal Design).','',NULL),(1463,'Students will design and implement constructivist based learning activities based on the needs of all of their students to: Peers through a lesson study process; Local 7th-12th grade students\n','',NULL),(1464,'Students will demonstrate an understanding that students are unique individuals and lesson plans developed in this course are designed to ensure all students have the opportunity to be successful. (UDL)','',NULL),(1465,'UDL/DI','',NULL),(1466,'DI','',NULL),(1467,'DI','',NULL),(1468,'EdTPA','',NULL),(1469,'Professionalism','',NULL),(1470,'Demonstrate an understanding of how curriculum is developed and how curriculum is influenced by state and professional standards as well as the local, state, and federal levels.','',NULL),(1471,'Demonstrate an understanding of how to utilize a conceptually-based and backward design approach to developing curriculum while simultaneously demonstrating a coherent theory of instruction based on \"best practices\" and current educational research.','',NULL),(1472,'Develop authentic formative and summative assessments and grading criteria/rubrics that (a) involve multiples sources and opportunities, (b) are linked to learning objectives and standards, and (c) are used to inform instructional practice.','',NULL),(1473,'Demonstrate an understanding of when and how to use a variety of informal and formal, as well as formative and summative assessments in order to determine students\' progress and plan instruction.','',NULL),(1474,'Make content accessible to all students by applying instructional scaffolding to all lessons and making accommodations for students of diverse needs and interests.','',NULL),(1475,'Demonstrate an understanding and ability to promote classroom norms that involve active discourse and use of academic language and argument in a safe and inclusive environment.','',NULL),(1476,'Apply conservation of energy/momentum to problems involving collisions and orbits','',NULL),(1477,'Use vectors, reference frames, FBD to set up problems.','',NULL),(1478,'Apply Newton\'s laws, conservation of energy to dynamics problems.','',NULL),(1479,'Formulate and solve a problem using generalized coordinates and the Lagrangian.','',NULL),(1480,'Apply Newton\'s laws and solve for rotational motion.','',NULL),(1481,'Use computational approach to solve dynamics problem.','',NULL);

