scientific and/or technical information or ideas (e.g. about phenomena and/or the process of development and the design and performance of a proposed process or system) in multiple formats (i.e., orally, graphically, textually, mathematically).','',286),(1060,'Different patterns may be observed at each of the scales at which a system is studied and can provide evidence for causality in explanations of phenomena.','',287),(1061,'Empirical evidence is needed to identify patterns.','',287),(1062,'Empirical evidence is required to differentiate between cause and correlation and make claims about specific causes and effects. ','',288),(1063,'Cause and effect relationships can be suggested and predicted for complex natural and human designed systems by examining what is known about smaller scale mechanisms within the system.','',288),(1064,'The significance of a phenomenon is dependent on the scale, proportion, and quantity at which it occurs.','',289),(1065,'Using the concept of orders of magnitude allows one to understand how a model at one scale relates to a model at another scale.','',289),(1066,'Algebraic thinking is used to examine scientific data and predict the effect of a change in one variable on another (e.g., linear growth vs. exponential growth).','',289),(1067,'Models (e.g., physical, mathematical, computer models) can be used to simulate systems and interactions-including energy, matter, and information flows-within and between systems at different scales. ','',290),(1068,'When investigating or describing a system, the boundaries and initial conditions of the system need to be defined and their inputs and outputs analyzed and described using models.','',290),(1069,'Models can be used to predict the behavior of a system, but these predictions have limited precision and reliability due to the assumptions and approximations inherent in models.','',290),(1070,'The total amount of energy and matter in closed systems is conserved. ','',291),(1071,'Changes of energy and matter in a system can be described in terms of energy and matter flows into, out of, and within that system.','',291),(1072,'Energy cannot be created or destroyed-only moves between one place and another place, between objects and/or fields, or between systems.','',291),(1073,'Energy drives the cycling of matter within and between systems.','',291),(1074,'In nuclear processes, atoms are not conserved, but the total number of protons plus neutrons is conserved.','',291),(1075,'Investigating or designing new systems or structures requires a detailed examination of the properties of different materials, the structures of different components, and connections of components to reveal its function and/or solve a problem.','',292),(1076,'The functions and properties of natural and designed objects and systems can be inferred from their overall structure, the way their components are shaped and used, and the molecular substructures of its various materials.','',292),(1077,'Much of science deals with constructing explanations of how things change and how they remain stable.','',293),(1078,'Systems can be designed for greater or lesser stability.','',293),(1079,'Feedback (negative or positive) can stabilize or destabilize a system.','',293),(1080,'Change and rates of change can be quantified and modeled over very short or very long periods of time. Some system changes are irreversible.','',293),(1081,'The star called the sun is changing and will burn out over a lifespan of approximately 10 billion years. (HS-ESS1-1)','',294),(1082,'The study of stars\' light spectra and brightness is used to identify compositional elements of stars, their movements, and their distances from Earth. (HS-ESS1-2),(HS-ESS1-3)','',294),(1083,'The Big Bang theory is supported by observations of distant galaxies receding from our own, of the measured composition of stars and non-stellar gases, and of the maps of spectra of the primordial radiation (cosmic microwave background) that still fills the universe. (HS-ESS1-2)','',294),(1084,'Other than the hydrogen and helium formed at the time of the Big Bang, nuclear fusion within stars produces all atomic nuclei lighter than and including iron, and the process releases electromagnetic energy. Heavier elements are produced when certain massive stars achieve a supernova stage and explode. (HS-ESS1-2),(HS-ESS1-3)','',294),(1085,'Kepler\'s laws describe common features of the motions of orbiting objects, including their elliptical paths around the sun. Orbits may change due to the gravitational effects from, or collisions with, other objects in the solar system. (HS-ESS1-4)','',295),(1086,'Cyclical changes in the shape of Earth\'s orbit around the sun, together with changes in the tilt of the planet\'s axis of rotation, both occurring over hundreds of thousands of years, have altered the intensity and distribution of sunlight falling on the earth. These phenomena cause a cycle of ice ages and other gradual climate changes. (secondary to HS-ESS2-4)','',295),(1087,'Continental rocks, which can be older than 4 billion years, are generally much older than the rocks of the ocean floor, which are less than 200 million years old. (HS-ESS1-5)','',296),(1088,'Although active geologic processes, such as plate tectonics and erosion, have destroyed or altered most of the very early rock record on Earth, other objects in the solar system, such as lunar rocks, asteroids, and meteorites, have changed little over billions of years. Studying these objects can provide information about Earth\'s formation and early history. (HS-ESS1-6)','',296),(1089,'Earth\'s systems, being dynamic and interacting, cause feedback effects that can increase or decrease the original changes. (HS-ESS2-1),(HS-ESS2-2)','',297),(1090,'The geological record shows that changes to global and regional climate can be caused by interactions among changes in the sun\'s energy output or Earth\'s orbit, tectonic events, ocean circulation, volcanic activity, glaciers, vegetation, and human activities. These changes can occur on a variety of time scales from sudden (e.g., volcanic ash clouds) to intermediate (ice ages) to very long-term tectonic cycles. (HS-ESS2-4)','',297),(1091,'Evidence from deep probes and seismic waves, reconstructions of historical changes in Earth\'s surface and its magnetic field, and an understanding of physical and chemical processes lead to a model of Earth with a hot but solid inner core, a liquid outer core, a solid mantle and crust. (HS-ESS2-3)','',297),(1092,'Motions of the mantle and its plates occur primarily through thermal convection, which involves the cycling of matter due to the outward flow of energy from Earth\'s interior and gravitational movement of denser materials toward the interior. (HS-ESS2-3)','',297),(1093,'The radioactive decay of unstable isotopes continually generates new energy within Earth\'s crust and mantle, providing the primary source of the heat that drives mantle convection. Plate tectonics can be viewed as the surface expression of mantle convection. (HS-ESS2-3)','',298),(1094,'Plate tectonics is the unifying theory that explains the past and current movements of the rocks at Earth\'s surface and provides a framework for understanding its geologic history. Plate movements are responsible for most continental and ocean-floor features and for the distribution of most rocks and minerals within Earth\'s crust. (ESS2.B Grade 8 GBE) (HS-ESS2-1)','',298),(1095,'The abundance of liquid water on Earth\'s surface and its unique combination of physical and chemical properties are central to the planet\'s dynamics. These properties include water\'s exceptional capacity to absorb, store, and release large amounts of energy, transmit sunlight, expand upon freezing, dissolve and transport materials, and lower the viscosities and melting points of rocks. (HS-ESS2-5)','',299),(1096,'The foundation for Earth\'s global climate systems is the electromagnetic radiation from the sun, as well as its reflection, absorption, storage, and redistribution among the atmosphere, ocean, and land systems, and this energy\'s re-radiation into space. (HS-ESS2-2)(HS-ESS2-4) ','',300),(1097,'Gradual atmospheric changes were due to plants and other organisms that captured carbon dioxide and released oxygen. (HS-ESS2-6),(HS-ESS2-7)','',300),(1098,'Changes in the atmosphere due to human activity have increased carbon dioxide concentrations and thus affect climate. (HS-ESS2-6),(HS-ESS2-4)','',300),(1099,'Current models predict that, although future regional climate changes will be complex and varied, average global temperatures will continue to rise. The outcomes predicted by global climate models strongly depend on the amounts of human-generated greenhouse gases added to the atmosphere each year and by the ways in which these gases are absorbed by the ocean and biosphere. (secondary to HS-ESS3-6)','',300),(1100,'The many dynamic and delicate feedbacks between the biosphere and other Earth systems cause a continual co-evolution of Earth\'s surface and the life that exists on it. (HS-ESS2-7)','',301),(1101,'Resource availability has guided the development of human society. (HS-ESS3-1)','',302),(1102,'All forms of energy production and other resource extraction have associated economic, social, environmental, and geopolitical costs and risks as well as benefits. New technologies and social regulations can change the balance of these factors. (HS-ESS3-2)','',302),(1103,'Natural hazards and other geologic events have shaped the course of human history; [they] have significantly altered the sizes of human populations and have driven human migrations. (HS-ESS3-1)','',303),(1104,'The sustainability of human societies and the biodiversity that supports them requires responsible management of natural resources. (HS-ESS3-3)','',304),(1105,'Scientists and engineers can make major contributions by developing technologies that produce less pollution and waste and that preclude ecosystem degradation. (HS-ESS3-4)','',304),(1106,'Though the magnitudes of human impacts are greater than they have ever been, so too are human abilities to model, predict, and manage current and future impacts. (HS-ESS3-5)','',305),(1107,'Through computer simulations and other studies, important discoveries are still being made about how the ocean, the atmosphere, and the biosphere interact and are modified in response to human activities. (HS-ESS3-6)','',305),(1108,'Systems of specialized cells within organisms help them perform the essential functions of life. (HS-LS1-1)','',306),(1109,'All cells contain genetic information in the form of DNA molecules. Genes are regions in the DNA that contain the instructions that code for the formation of proteins, which carry out most of the work of cells. (HS-LS1-1) (Note: This Disciplinary Core Idea is also addressed by HS-LS3-1.)','',306),(1110,'Multicellular organisms have a hierarchical structural organization, in which any one system is made up of numerous parts and is itself a component of the next level. (HS-LS1-2)','',306),(1111,'Feedback mechanisms maintain a living system\'s internal conditions within certain limits and mediate behaviors, allowing it to remain alive and functional even as external conditions change within some range. Feedback mechanisms can encourage (through positive feedback) or discourage (negative feedback) what is going on inside the living system. (HS-LS1-3)','',306),(1112,'In multicellular organisms individual cells grow and then divide via a process called mitosis, thereby allowing the organism to grow. The organism begins as a single cell that divides successively to produce many cells, with each parent cell passing identical genetic material to both daughter cells. Cellular division and differentiation produce and maintain a complex organism, composed of systems of tissues and organs that work together to meet the needs of the whole organism.','',307),(1113,'The process of photosynthesis converts light energy to stored chemical energy by converting carbon dioxide plus water into sugars plus released oxygen. (HS-LS1-5)','',308),(1114,'The sugar molecules thus formed contain carbon, hydrogen, and oxygen: their hydrocarbon backbones are used to make amino acids and other carbon-based molecules that can be assembled into larger molecules (such as proteins or DNA), used for example to form new cells. (HS-LS1-6)','',308),(1115,'As matter and energy flow through different organizational levels of living systems, chemical elements are recombined in different ways to form different products. (HS-LS1-6),(HS-LS1-7)','',308),(1116,'As a result of these chemical reactions, energy is transferred from one system of interacting molecules to another. Cellular respiration is a chemical process in which the bonds of food molecules and oxygen molecules are broken and new compounds are formed that can transport energy to muscles. Cellular respiration also releases the energy needed to maintain body temperature despite ongoing energy transfer to the surrounding environment. (HS-LS1-7)','',308),(1117,'Ecosystems have carrying capacities, which are limits to the numbers of organisms and populations they can support. These limits result from such factors as the availability of living and nonliving resources and from such challenges such as predation, competition, and disease. Organisms would have the capacity to produce populations of great size were it not for the fact that environments and resources are finite. This fundamental tension affects the abundance of species in any given ecosystem.','',309),(1118,'Photosynthesis and cellular respiration (including anaerobic processes) provide most of the energy for life processes. (HS-LS2-3)','',310),(1119,'Plants or algae form the lowest level of the food web. At each link upward in a food web, only a small fraction of the matter consumed at the lower level is transferred upward, to produce growth and release energy in cellular respiration at the higher level. Given this inefficiency, there are generally fewer organisms at higher levels of a food web. (HS-LS2-4)','',310),(1120,'Some matter reacts to release energy for life functions, some matter is stored in newly made structures, and much is discarded. The chemical elements that make up the molecules of organisms pass through food webs and into and out of the atmosphere and soil, and they are combined and recombined in different ways. At each link in an ecosystem, matter and energy are conserved. (HS-LS2-4)','',310),(1121,'Photosynthesis and cellular respiration are important components of the carbon cycle, in which carbon is exchanged among the biosphere, atmosphere, oceans, and geosphere through chemical, physical, geological, and biological processes. (HS-LS2-5)','',310),(1122,'A complex set of interactions within an ecosystem can keep its numbers and types of organisms relatively constant over long periods of time under stable conditions. If a modest biological or physical disturbance to an ecosystem occurs, it may return to its more or less original status, as opposed to becoming a very different ecosystem.(HS-LS2-2),(HS-LS2-6)','',311),(1123,'Extreme fluctuations in conditions or the size of any population can challenge the functioning of ecosystems in terms of resources and habitat availability. (HS-LS2-2),(HS-LS2-6)','',311),(1124,'Anthropogenic changes (induced by human activity) in the environment-including habitat destruction, pollution, introduction of invasive species, overexploitation, and climate change-can disrupt an ecosystem and threaten the survival of some species. (HS-LS2-7)','',311),(1125,'Group behavior has evolved because membership can increase the chances of survival for individuals and their genetic relatives. (HS-LS2-8)','',312),(1126,'Each chromosome consists of a single very long DNA molecule, and each gene on the chromosome is a particular segment of that DNA. The instructions for forming species\' characteristics are carried in DNA. All cells in an organism have the same genetic content, but the genes used (expressed) by the cell may be regulated in different ways. Not all DNA codes for a protein; some segments of DNA are involved in regulatory or structural functions, and some have no as-yet known function. (HS-LS3-1)','',313),(1127,'In sexual reproduction, chromosomes can sometimes swap sections during the process of meiosis (cell division), thereby creating new genetic combinations and thus more genetic variation. Although DNA replication is tightly regulated and remarkably accurate, errors do occur and result in mutations, which are also a source of genetic variation. Environmental factors can also cause mutations in genes, and viable mutations are inherited. (HS-LS3-2)','',314),(1128,'Environmental factors also affect expression of traits, and hence affect the probability of occurrences of traits in a population. Thus the variation and distribution of traits observed depends on both genetic and environmental factors. (HS-LS3-2),(HS-LS3-3)','',314),(1129,'Genetic information, like the fossil record, provides evidence of evolution. DNA sequences vary among species, but there are many overlaps; in fact, the ongoing branching that produces multiple lines of descent can be inferred by comparing the DNA sequences of different organisms. Such information is also derivable from the similarities and differences in amino acid sequences and from anatomical and embryological evidence. (HS-LS4-1)','',315),(1130,'Natural selection occurs only if there is both (1) variation in the genetic information between organisms in a population and (2) variation in the expression of that genetic information-that is, trait variation-that leads to differences in performance among individuals. (HS-LS4-2),(HS-LS4-3)','',316),(1131,'The traits that positively affect survival are more likely to be reproduced, and thus are more common in the population. (HS-LS4-3)','',316),(1132,'Evolution is a consequence of the interaction of four factors: (1) the potential for a species to increase in number, (2) the genetic variation of individuals in a species due to mutation and sexual reproduction, (3) competition for an environment\'s limited supply of the resources that individuals need in order to survive and reproduce, and (4) the ensuing proliferation of those organisms that are better able to survive and reproduce in that environment. (HS-LS4-2)','',317),(1133,'Natural selection leads to adaptation to a population dominated by organisms that are anatomically, behaviorally, and physiologically well suited to survive and reproduce in a specific environment. The differential survival and reproduction of organisms in a population that have an advantageous heritable trait leads to an increase in the proportion of individuals in future generations that have the trait and to a decrease in the proportion of individuals that do not. (HS-LS4-3),(HS-LS4-4)','',317),(1134,'Adaptation also means that the distribution of traits in a population can change when conditions change. (HS-LS4-3)','',317),(1135,'Changes in the physical environment, whether naturally occurring or human induced, have thus contributed to the expansion of some species, the emergence of new distinct species as populations diverge under different conditions, and the decline-and sometimes the extinction-of some species. (HS-LS4-5),(HS-LS4-6)','',317),(1136,'Species become extinct because they can no longer survive and reproduce in their altered environment. If members cannot adjust to change that is too fast or drastic, the opportunity for the species\' evolution is lost. (HS-LS4-5)','',317),(1137,'Biodiversity is increased by the formation of new species (speciation) and decreased by the loss of species (extinction). (secondary to HS-LS2-7)','',318),(1138,'Humans depend on the living world for the resources and other benefits provided by biodiversity. But human activity is also having adverse impacts on biodiversity through overpopulation, overexploitation, habitat destruction, pollution, introduction of invasive species, and climate change. (HS-LS2-7; HS-LS4-6)','',318),(1139,'Sustaining biodiversity so that ecosystem functioning and productivity are maintained is essential to supporting and enhancing life on Earth. Sustaining biodiversity also aids humanity by preserving landscapes of recreational or inspirational value. (HS-LS2-7; HS-LS4-6)','',318);

